#define WT_TOTAL_WAVETABLE_COUNT 8
    

#define WT_HZ 40.0f
#define WT_FRAMES_PER_CYCLE 1200
#define WT_SR 48000.0f
//#define WT_HZ_RECIP (1.0f/WT_HZ)

typedef struct st_wavetable
{
    int length;
    float * wavetable;
}t_wavetable;

t_wavetable * g_wavetable_get();

t_wavetable * g_wavetable_get()
{
    t_wavetable * f_result;
    if(posix_memalign((void**)&f_result, 16, (sizeof(t_wavetable))) != 0){return 0;}
    if(posix_memalign((void**)&f_result->wavetable, 16, (sizeof(float) * WT_FRAMES_PER_CYCLE)) != 0){return 0;}    
    f_result->length = WT_FRAMES_PER_CYCLE;
    return f_result;
}

typedef struct 
{
    t_wavetable ** tables;
    int f_count;
}t_wt_wavetables;

t_wt_wavetables * g_wt_wavetables_get();

t_wt_wavetables * g_wt_wavetables_get()
{
    int f_i = 0;
    t_wt_wavetables * f_result;
    if(posix_memalign((void**)&f_result, 16, (sizeof(t_wt_wavetables))) != 0){return 0;}
    f_result->f_count = WT_TOTAL_WAVETABLE_COUNT;
    if(posix_memalign((void**)&f_result->tables, 16, (sizeof(t_wavetable) * WT_TOTAL_WAVETABLE_COUNT)) != 0){return 0;}

    f_result->tables[0] = g_wavetable_get();
    f_i = 0;
    while(f_i < WT_FRAMES_PER_CYCLE)
    {
        f_result->tables[0]->wavetable[f_i] = plain_saw_array[f_i]; 
        f_i++;
    }

    f_result->tables[1] = g_wavetable_get();
    f_i = 0;
    while(f_i < WT_FRAMES_PER_CYCLE)
    {
        f_result->tables[1]->wavetable[f_i] = superbsaw_array[f_i]; 
        f_i++;
    }

    
    f_result->tables[2] = g_wavetable_get();
    f_i = 0;
    while(f_i < WT_FRAMES_PER_CYCLE)
    {
        f_result->tables[2]->wavetable[f_i] = viralsaw_array[f_i]; 
        f_i++;
    }
    
    f_result->tables[3] = g_wavetable_get();
    f_i = 0;
    while(f_i < WT_FRAMES_PER_CYCLE)
    {
        f_result->tables[3]->wavetable[f_i] = soft_saw_array[f_i]; 
        f_i++;
    }
    
    
    f_result->tables[4] = g_wavetable_get();
    f_i = 0;
    while(f_i < WT_FRAMES_PER_CYCLE)
    {
        f_result->tables[4]->wavetable[f_i] = evil_square_array[f_i]; 
        f_i++;
    }
    
    f_result->tables[5] = g_wavetable_get();
    f_i = 0;
    while(f_i < WT_FRAMES_PER_CYCLE)
    {
        f_result->tables[5]->wavetable[f_i] = soft_square_array[f_i]; 
        f_i++;
    }
    
    f_result->tables[6] = g_wavetable_get();
    f_i = 0;
    while(f_i < WT_FRAMES_PER_CYCLE)
    {
        f_result->tables[6]->wavetable[f_i] = pink_glitch_array[f_i]; 
        f_i++;
    }
    
    f_result->tables[7] = g_wavetable_get();
    f_i = 0;
    while(f_i < WT_FRAMES_PER_CYCLE)
    {
        f_result->tables[7]->wavetable[f_i] = white_glitch_array[f_i]; 
        f_i++;
    }
    
    return f_result;
}



